import React, { useEffect, useState } from 'react';

const VeterinariansList = () => {
  const [veterinarians, setVeterinarians] = useState([]);

  useEffect(() => {
    fetch('/api/veterinarians')
      .then((response) => response.json())
      .then((data) => setVeterinarians(data))
      .catch((error) => console.error('Error fetching veterinarians:', error));
  }, []);

  return (
    <div>
      <h1>Veterinarians List</h1>
      <ul>
        {veterinarians.map((vet) => (
          <li key={vet.id}>{vet.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default VeterinariansList;
